When Bjork Met Attenborough
Award-winning musician Bjork and legendary broadcaster and naturalist Sir David Attenborough have admired each other's work for years but this is the first time they have discussed their mutual love of music and the natural world on screen. In this remarkable documentary, Bjork explores our unique relationship with music and discovers how technology might transform the way we engage with it in the future.
At the heart of the film is Biophilia, Bjork's cutting-edge music project that explores where nature, music and technology meet. David Attenborough explains how music exists in the natural world and speaks about his own passion for music.
Author and professor of neurology and psychiatry Oliver Sacks explains the extraordinary and beneficial effects music has on our brains and explains why performing and engaging with music is something all of us should take more seriously.

